import React, { useState } from "react";
import ReactDOM from 'react-dom';
import SignForm from './components/signForm';

function Fields() {
    let [fields] = useState([
      {
        type: "text",
        name: "username",
        placeholder: "Username",
        id: "username",

      },
      {
        type: "email",
        name: "email",
        placeholder: "Email",
        id: "email",
      },
      {
        type: "password",
        name: "password",
        placeholder: "Password",
        id: "password",
      },
      {
        type: "password",
        name: "confirmPassword",
        placeholder: "Confirm Password",
        id: "confirmPassword",
      },
    ]);
ReactDOM.render(<SignForm info= {fields}/>, document.getElementById("root"));
}
//darle estilo al fomrulario y a los errores del formulario
//Principal le manda info a los demas
//<div>

export default Fields;
